import React from 'react';
import '../css/ajax.css';

function AJAXButton(){
    return(
        <div className="ajax-body">
            <div className="container text-center">
                <h1 className="display-4 mt-3 mb-5" id="ajax-title">AJAX API Fetch (Coronavirus API)</h1>
                <br/>
                <br/>

                <button className="btn btn-success">Fetch!</button>
            </div>
        </div>
    )
}

export default AJAXButton;
